INSERT INTO `audit_log` VALUES ('root', '/ccintelligence/api/questions', 'A', '{\"q_id\":7354743784,\"title\":\"Do I have to purchase insurance?\",\"answer\":\"Texas law requires drivers to be able to pay for the accidents they \\ncause. Most people meet this requirement by buying automobile \\n\'liability\' insurance. Liability insurance pays to treat people injured \\nin an accident that you cause. It also pays to repair or replace the \\nother driver\\u00b4s damaged property.\",\"status\":\"A\",\"created_by\":\"root\",\"created_at\":\"2020-02-13 12:46:46\"}', '192.168.1.84', '2020-02-13 12:46:46', 'Question Insert');
INSERT INTO `audit_log` VALUES ('root', '/ccintelligence/api/questions', 'A', '{\"q_id\":8603296437,\"title\":\"Who pays to fix my car if I am in an accident?\",\"answer\":\"Liability insurance pays to repair the other driver\\u00b4s car and does NOT \\npay to fix your car. You will need to add \'collision\' coverage to your \\npolicy to pay to fix your car if it\\u00b4s damaged in a wreck that you \\ncaused. \'Comprehensive coverage pays to repair or replace your car if \\nit\\u00b4s stolen or damaged by hail, fire, road debris, vandalism or other \\nsimilar covered risks. Texas law does not require you to have collision \\nand comprehensive coverage. However, if you still owe money on your car,\\n your lender will probably require you to have them. If your car is \\ndamaged in a wreck caused by another driver, the other driver\\u00b4s \\ninsurance will pay to fix your car, up to the other driver\\u00b4s policy \\nlimits.\",\"status\":\"A\",\"created_by\":\"root\",\"created_at\":\"2020-02-13 12:47:35\"}', '192.168.1.84', '2020-02-13 12:47:35', 'Question Insert');
INSERT INTO `audit_log` VALUES ('root', '/ccintelligence/api/questions', 'A', '{\"q_id\":7421480185,\"title\":\"What will happen if I don\'t have auto insurance?\",\"answer\":\"Driving without auto insurance is against the law. A law enforcement \\nofficer will require you to show proof that you have auto insurance \\nduring any traffic stop. Your insurance company will provide you with an\\n \'insurance card\' that will qualify as your proof of insurance. The card\\n will explain the basic features of your auto policy, including the \\ndates the coverage begins and ends. You should keep your insurance card \\nwith you while driving. If you are unable to show proof of insurance, \\nyou will probably get a ticket. You could face a fine of $175 to $350 \\nfor a first offense. If you are stopped again without proof of \\ninsurance, you could be fined up to $1,000, your vehicle could be \\nimpounded for 180 days, and you could have your driver license \\nsuspended.\",\"status\":\"A\",\"created_by\":\"root\",\"created_at\":\"2020-02-13 12:48:34\"}', '192.168.1.84', '2020-02-13 12:48:34', 'Question Insert');
INSERT INTO `audit_log` VALUES ('root', '/ccintelligence/api/questions', 'A', '{\"q_id\":9508142016,\"title\":\"How do companies decide what kind of risk I might pose for an accident?\",\"answer\":\"Each company evaluates risk differently. All companies generally use \\nsome type of formula that considers a variety of \'risk factors.\' These \\nfactors include:&nbsp;Driving history,&nbsp;Age,&nbsp;Gender,&nbsp;Lifestyle,&nbsp;Credit History etc.\",\"status\":\"A\",\"created_by\":\"root\",\"created_at\":\"2020-02-13 12:50:42\"}', '192.168.1.84', '2020-02-13 12:50:42', 'Question Insert');
INSERT INTO `audit_log` VALUES ('root', '/ccintelligence/api/questions', 'A', '{\"q_id\":6126210663,\"title\":\"Can I buy insurance at a car dealership?\",\"answer\":\"No. In Texas, insurance may only be sold by an insurance agent or broker licensed by the Texas Department of Insurance (TDI).\",\"status\":\"A\",\"created_by\":\"root\",\"created_at\":\"2020-02-13 12:51:32\"}', '192.168.1.84', '2020-02-13 12:51:32', 'Question Insert');
INSERT INTO `audit_log` VALUES ('root', '/ccintelligence/api/questions', 'A', '{\"q_id\":7700890502,\"title\":\"What if my friend has a wreck while driving my car?\",\"answer\":\"In most cases, the vehicle owner\\u00b4s insurance pays for losses, regardless\\n of who was driving. This means that if you\\u00b4re in a wreck while driving a\\n friend\\u00b4s car, your friend\\u00b4s policy will usually pay for it. If you have\\n an auto policy, your insurance would pay any remaining amount that \\nexceeds your friend\\u00b4s policy limits. If your friend does not have \\ninsurance and you\\u00b4re involved in an accident while driving his or her \\ncar, your policy will pay. Likewise, if a friend has an accident while \\ndriving your car, your policy will pay first, and your friend\\u00b4s policy \\nwill pay any remaining amount that exceeds your policy limits. If you do\\n not have insurance and your friend is involved in an accident while \\ndriving your car, your friend\\u00b4s policy will pay.\",\"status\":\"A\",\"created_by\":\"root\",\"created_at\":\"2020-02-13 12:52:33\"}', '192.168.1.84', '2020-02-13 12:52:33', 'Question Insert');
